import { __assign } from "tslib";
import event from './event';
import { repTypes } from '../../config';
var force = false;
/** 弹框点击 */
export function dialogClick(metaId, extra) {
    force = false;
    base(metaId, extra);
}
export function dialogClickForce(metaId, extra) {
    force = true;
    base(metaId, extra);
}
function base(metaId, extra) {
    return event.bind(this)(metaId, repTypes.UBT.subTypes.DIALOG_CLICK, __assign({}, extra), force);
}
